import React from 'react';


import { Jumbotron, Button, Row, Col } from "react-bootstrap";
import './section2.css';

import EIC from './Exchange_Info_card_left';


const Section2 = () => {
    return (
      <div className="container align-middle">
        <div className="col-12">
          <div className="row main__section">
            <div className="col-4">
              <EIC />
            </div>
            <div className="col-4">
              <EIC />
            </div>
            <div className="col-4">
              <EIC />
            </div>
          </div>
        </div>
      </div>
    );
}

export default Section2
